import React from 'react';
import './Board.css';
import image6 from '../assets/LeilaErhili.png';
import image7 from '../assets/Maddie_Follosco.jpeg';
import image8 from '../assets/IreneChang.png';
import image9 from '../assets/SanjnaSood.png';
import image10 from '../assets/PrakritiPatnaik.png';
import image11 from '../assets/Anna_Aldri.png';
import image12 from '../assets/Catherine_Hung.png';
import image13 from '../assets/Ananya_Pagadala.png';
import image14 from '../assets/Samia_Ahmer.png';
import image15 from '../assets/Sattvika_Bhatt.png';
import image16 from '../assets/Trisha_Ganesh.png';
import image18 from '../assets/Group 6.png';

const boardMembers = [
  { name: 'Leila Erhili', role: 'President', image: image6 },
  { name: 'Maddie Follosco', role: 'Vice President', image: image7 },
  { name: 'Irene Change', role: 'Event Coordinator', image: image8 },
  { name: 'Sanjna Sood', role: 'Secretary', image: image9 },
  { name: 'Prakriti Patnaik', role: 'Web-Master', image: image10 },
  { name: 'Anna Aldrin', role: 'Event Coordinator', image: image11 },
  { name: 'Catherine Hung', role: 'Treasurer', image: image12 },
  { name: 'Ananya Pagadala', role: 'Career, Conference Advisor', image: image13 },
  { name: 'Samia Ahmer', role: 'Director of Public Relations', image: image14 },
  { name: 'Sattvika Bhatt', role: 'Hack-a-thon Coordinator', image: image15 },
  { name: 'Trisha Ganesh', role: 'Industry Liaison', image: image16 },
  { name: 'Sara Donnelly', role: 'Freshmen Rep', image: image18 },
  { name: 'Kaavya Jethwa', role: 'Freshmen Rep', image: image13 }
];

const Board = () => {
  return (
    <div className="board-page">
      <div className="banner">
        <img src={image18} alt="Board banner" className="banner-image" />
        <div className="banner-title">
          <h1 className="board-title">2024-2025</h1>
        </div>
      </div>

      <div className="members-container">
        {boardMembers.map((member, index) => (
          <div key={index} className="member-card">
            <div className="member-image-frame">
              <img src={member.image} alt={member.name} className="member-image" />
            </div>
            <h2 className="member-name">{member.name}</h2>
            <p className="member-role">{member.role}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Board;
